import React, { useState } from 'react';
import './skills.scss';
import AcUnitIcon from '@mui/icons-material/AcUnit';
import BuildCircleIcon from '@mui/icons-material/BuildCircle';
import ComputerIcon from '@mui/icons-material/Computer';
import AndroidIcon from '@mui/icons-material/Android';

const Skills = () => {
    const [expanded, setExpanded] = useState(false);
    const [isHovered, setIsHovered] = useState(false);

    const handleSkillClick = () => {
        setExpanded(!expanded);
    };

    const handleMouseEnter = () => {
        setIsHovered(true);
    };

    const handleMouseLeave = () => {
        setIsHovered(false);
    };

    return (
        <div className='skills'>
            <div className="center">
                <div className={`skill-circle ${expanded ? 'expanded' : ''}`} onClick={handleSkillClick}>
                    SKILLS
                    {expanded && (
                        <div className="divisions">
                            <div className="division" >
                                <div><ComputerIcon /></div>
                                <div onMouseEnter={handleMouseEnter} onMouseLeave={handleMouseLeave}>
                                    <p className='fs' >Front-end Skills</p>
                                    {isHovered && (
                                        <div className="hover">

                                            <div><ComputerIcon />
                                            </div>

                                            
                                                <h1>Front-end Development Skills</h1>
                                                <ul>
                                                    <li>React js</li>
                                                    <li>HTML5</li>
                                                    <li>CSS3</li>
                                                    <li>JavaScript (Including Ajax, Redux)</li> 
                                                </ul>
                                            
                                        </div>
                                    )}
                                </div>
                            </div>
                            <div className="division">
                                <div><BuildCircleIcon /></div>
                                <p className='bs'>Back-end Skills</p>
                                {isHovered && (
                                        <div className="hover">

                                            <div><ComputerIcon />
                                            </div>

                                            
                                                <h1>Front-end Development Skills</h1>
                                                <ul>
                                                    <li>React js</li>
                                                    <li>HTML5</li>
                                                    <li>CSS3</li>
                                                    <li>JavaScript (Including Ajax Redux)</li> {/* Corrected the closing tag here */}
                                                </ul>
                                            
                                        </div>
                                    )}
                            </div>
                            <div className="division">
                                <div><AcUnitIcon /></div>
                                <p className='ss'>Soft Skills</p>
                                {isHovered && (
                                        <div className="hover">

                                            <div><ComputerIcon />
                                            </div>

                                            
                                                <h1>Front-end Development Skills</h1>
                                                <ul>
                                                    <li>React js</li>
                                                    <li>HTML5</li>
                                                    <li>CSS3</li>
                                                    <li>JavaScript (Including Ajax Redux)</li> {/* Corrected the closing tag here */}
                                                </ul>
                                            
                                        </div>
                                    )}
                            </div>
                            <div className="division">
                                <div><AndroidIcon /></div>
                                <p className='as'>AI & Other Skills</p>
                                {isHovered && (
                                        <div className="hover">

                                            <div><ComputerIcon />
                                            </div>

                                            
                                                <h1>AI Development Skills</h1>
                                                <ul>
                                                    <li>Python</li>
                                                    <li>Machine Learning </li>
                                                    <li>Keras</li>
                                                    <li>Tensorflow</li>
                                                    <li>pandas</li>
                                                    <li>Data Analysis</li>
                                                </ul>
                                                <h1>Other Skills</h1>
                                                <ul>
                                                <li>Version control: Git And GitHub</li>
                                                    <li>Database Management: MySQL & MongoDB </li>
                                                    </ul>   
                                            
                                        </div>
                                    )}
                            </div>
                        </div>
                    )}
                </div>
            </div>
        </div>
    );
}

export default Skills;
